import React from "react";

const Dropdown = () => {
  return (
    <div className="dropdownAbout">
      <div className="dropdownAbout__top">
        <h3>Fiabilité</h3>
        <img src="/arrow-dropdown.png" alt="icon dropdown" />
      </div>
      <div className="dropdownAbout__bot">
        <ul>
          <li>Climatisation</li>
          <li>Wi-Fi</li>
          <li>Cuisine</li>
          <li>Espace de travail</li>
          <li>Fer à repasser</li>
          <li>Sèche-cheveux</li>
          <li>Cintres</li>
        </ul>
      </div>
    </div>
  );
};

export default Dropdown;
